import React, { useState } from 'react'
import './CSS/Login.css'

const Login = () => {

  const [state,setState] = useState("Login");
  const[formData,setFormData] = useState({
    username:"",
    password:"",
    email:""
  })



  return (
    <div className='login'>
      <form action="" className="formTU">
        <h1>{state}</h1>
        {state=== "Sign Up"? <input name='username' value={formData.username} type='text' placeholder='YOUR NAME' /> : <></>  }
        <input type="email" name='email' value={formData.email} placeholder='YOUR EMAIL' />
        <input type="password" name='password' value={formData.password} placeholder='YOUR PASSWORD' />
        <button type='button'   > {state} </button>
        {state === "Sign Up"?<p className="loginsignup-login">
                        Already have an account? <span onClick={()=>{setState("Login")}} > Login here </span>
                      </p> :<p className="loginsignup-login">
                        Create an account? <span onClick={()=>{setState("Sign Up")}} > Click here </span>
                      </p>}

      </form>
    </div>
  )
}

export default Login
